.markdown-writer-dialog .dialog-row {
  margin-bottom: 10px;
}
.markdown-writer-dialog .side-label {
  margin-left: 10px;
}
.markdown-writer-dialog .image-container {
  max-height: 320px;
  overflow: scroll;
}
.markdown-writer-dialog .image-container img {
  max-width: 100%;
  margin: 0 auto;
}
.markdown-writer-dialog .col-1 {
  display: inline-block;
  width: 31%;
  margin-right: 2%;
}
.markdown-writer-dialog .col-2 {
  display: inline-block;
  width: 34%;
}
.markdown-writer-list {
  list-style: none;
  padding: 0;
  margin: 0;
  max-height: 170px;
  overflow: scroll;
}
.markdown-writer-list li {
  padding: 5px 3px;
  border: 1px solid transparent;
  background-color: #263238;
  margin-bottom: 2px;
  cursor: pointer;
}
.markdown-writer-list li:hover {
  background-color: #304047;
  color: #EEFFFF;
}
.markdown-writer-selection .candidates {
  list-style: none;
  padding: 0;
  height: 209px;
  overflow-y: scroll;
}
.markdown-writer-selection .candidates li {
  display: inline-block;
  padding: 5px;
  margin: 0 2px 2px 0;
  border: 1px solid transparent;
  background-color: #263238;
  cursor: pointer;
}
.markdown-writer-selection .candidates li.selected {
  background-color: #263238;
  color: rgba(255, 255, 255, 0.8);
}
.markdown-writer-selection .candidates li.selected:hover {
  background-color: #8BC34A;
  color: #EEFFFF;
}
.markdown-writer-selection .candidates li:hover {
  background-color: #304047;
  color: #EEFFFF;
}
